function LayoutDefault() {
  return (
    <>
      <div class="layout-default">
        <header>
          <div>Logo</div>
          <div>Menu</div>
        </header>
        <main></main>
        <footer></footer>
      </div>
    </>
  );
}

export default LayoutDefault;
